import React, { useEffect } from "react";
import { Link } from "react-router-dom";
import LoginButton from "../../components/common/StoreButtons/StoreButtonOne";
// import StoreProductImage from "../../components/StoreProductImage";
// import StoreProductDescription from "../../components/StoreProductDescription";
import "./store_user.css";

const StoreDetails = () => {
  useEffect(() => {
    window.scrollTo(0, 0);
  }, []);

  return (
    <main className="store__login store__container">
      <section className="store__login--section">
        <h2 className="store__login--title">Fa√ßa o login</h2>

        <form className="store__login--form">
          <label htmlFor="">Seu email</label>
          <input type="email" placeholder="Email" />
          <label htmlFor="">Senha</label>
          <input type="password" placeholder="Senha" />

          <LoginButton title={"Login"} type="submit" />
        </form>
      </section>
    </main>
  );
};

export default StoreDetails;
